theme.Product = (function() {

  var selectors = {
    addToCart: '[data-add-to-cart]',
    addToCartText: '[data-add-to-cart-text]',
    comparePrice: '[data-compare-price]',
    comparePriceText: '[data-compare-text]',
    formWrapper: '[data-form-wrapper]',
    originalSelectorId: '[data-product-select]',
    priceWrapper: '[data-price-wrapper]',
    productFeaturedImage: '[data-product-featured-image]',
    productSlideshow: '[data-product-slideshow]',
    productImage: '[data-product-image]',
    productJson: '[data-product-json]',
    productPrice: '[data-product-price]',
    productThumbs: '[data-product-thumbs]',
    singleOptionSelector: '[data-single-option-selector]'
  };

  /**
   * Product section constructor. Runs on page load as well as Theme Editor
   * `section:load` events.
   * @param {string} container - selector for the section container DOM element
   */
  function Product(container) {
    this.$container = $(container);

    // Stop parsing if we don't have the product json script tag when loading
    // section in the Theme Editor
    if (!$(selectors.productJson, this.$container).html()) {
      return;
    }

    this.initSlider();
    this.productVideo();
    this.accordion();
    this.tabs();
    this.tabsSpaceCheck();

    this.zoomEnable = this.$container.data('image-zoom-enable');
    if (this.zoomEnable) {
      this.productImageZoom();
    }

    var currentScope = this;
    $(window).resize(function() {
      currentScope.tabsSpaceCheck();
    }).resize();

    var sectionId = this.$container.attr('data-section-id');
    this.productSingleObject = JSON.parse($(selectors.productJson, this.$container).html());

    var options = {
      $container: this.$container,
      enableHistoryState: this.$container.data('enable-history-state') || false,
      singleOptionSelector: selectors.singleOptionSelector,
      originalSelectorId: selectors.originalSelectorId,
      product: this.productSingleObject
    };

    this.settings = {};
    this.namespace = '.product';
    this.variants = new slate.Variants(options);
    this.$featuredImage = $(selectors.productFeaturedImage, this.$container);

    this.$container.on('variantChange' + this.namespace, this.updateAddToCartState.bind(this));
    this.$container.on('variantPriceChange' + this.namespace, this.updateProductPrices.bind(this));
    this.$container.on('variantImageChange' + this.namespace, this.updateProductImage.bind(this));
  }

  Product.prototype = $.extend({}, Product.prototype, {

    /**
     * Updates the DOM state of the add to cart button
     *
     * @param {boolean} enabled - Decides whether cart is enabled or disabled
     * @param {string} text - Updates the text notification content of the cart
     */
    updateAddToCartState: function(evt) {
      var variant = evt.variant;

      if (variant) {
        $(selectors.priceWrapper, this.$container).removeClass('hide');
      } else {
        $(selectors.addToCart, this.$container).prop('disabled', true);
        $(selectors.addToCartText, this.$container).html(theme.strings.unavailable);
        $(selectors.formWrapper, this.$container).removeClass( "variant--soldout" ).addClass( "variant--unavailabe" );
        return;
      }

      if (variant.available) {
        $(selectors.addToCart, this.$container).prop('disabled', false);
        $(selectors.addToCartText, this.$container).html(theme.strings.addToCart);
        $(selectors.formWrapper, this.$container).removeClass( "variant--soldout variant--unavailabe" );
      } else {
        $(selectors.addToCart, this.$container).prop('disabled', true);
        $(selectors.addToCartText, this.$container).html(theme.strings.soldOut);
        $(selectors.formWrapper, this.$container).removeClass( "variant--unavailabe" ).addClass( "variant--soldout" );
        $(selectors.priceWrapper, this.$container).removeClass('hide');
      }
    },

    /**
     * Updates the DOM with specified prices
     *
     * @param {string} productPrice - The current price of the product
     * @param {string} comparePrice - The original price of the product
     */
    updateProductPrices: function(evt) {
      var variant = evt.variant;
      var $comparePrice = $(selectors.comparePrice, this.$container);

      $(selectors.productPrice, this.$container)
        .html(slate.Currency.formatMoney(variant.price, theme.moneyFormat));

      if (variant.compare_at_price > variant.price) {
        $comparePrice.html(slate.Currency.formatMoney(variant.compare_at_price, theme.moneyFormat));
      } else {
        $comparePrice.html('');
      }
    },

    /**
     * Updates the DOM with the specified image URL
     *
     * @param {string} src - Image src URL
     */
    updateProductImage: function(evt) {
      var variant = evt.variant;
      var imageId = variant.featured_image.id

      if (variant) {

        // Update variant image, if one is set
        if (variant.featured_image) {
          var newImg = $(selectors.productImage+'[data-image-id="'+ variant.featured_image.id +'"]', this.$container);
          var newPosition = newImg.closest('.product__photo').attr('data-slick-index');

          // Slider not loaded
          if (newPosition === undefined) {
            ;
          }else {
             $(selectors.productSlideshow, this.$container).slick('slickGoTo', newPosition);
          }
        }
      }

    },

    initSlider: function() {
      var swipeEnable = true;
      if ( this.zoomEnable && !Modernizr.touch ){ swipeEnable = false;}

      $(selectors.productSlideshow, this.$container).slick({
        adaptiveHeight: true,
        dots: true,
        fade: true,
        speed: 500,
        cssEase: 'linear',
        swipe: swipeEnable,
        appendDots: $(selectors.productThumbs, this.$container),
        customPaging: function(slider, i) {
            var thumb = $(slider.$slides[i]).data('thumb');
            return '<img src="'+thumb+'" role="tab" alt="">';
        }
      });

      $(selectors.image, this.$container).imagesLoaded(function(){
        $(selectors.productSlideshow, this.$container).slick('setPosition')
      });
    },
    productImageZoom: function() {
      if (Modernizr.touch) {
        return;
      }

      $(selectors.productImage, this.$container).magnificPopup({
        type: 'image',
        mainClass: 'mfp-fade',
        closeOnBgClick: true,
        closeBtnInside: false,
        closeOnContentClick: true,
        tLoading: '',
        removalDelay: 200
      });
    },
    productVideo: function() {
      $('.productVideo').magnificPopup({
        type: 'iframe',
        mainClass: 'mfp-fade',
        removalDelay: 160,
        closeBtnInside: false,
        preloader: false,
        fixedContentPos: false,
        iframe: {
          patterns: {
            youtube: {
              src: '//www.youtube.com/embed/%id%?autoplay=1&rel=0&showinfo=0'
            }
          }
        }
      });
    },
    accordion: function() {
      $('.accordion-js', this.$container).click(function() {
        if($(this).next('div').is(':visible')){
          $(this).next('div').slideUp('fast');
          $(this).toggleClass('accordion--open');
        } else {
          $(this).next('div').slideDown('fast');
          $(this).toggleClass('accordion--open');
        }
      });
    },
    tabs: function(){
      $('.tab-content-0', this.$container).addClass('current');
      $('.tab-link-0', this.$container).addClass('current');
      $('ul.tabs > li', this.$container).click(function(){
        var tab_id = $(this).attr('data-tab');
        $('ul.tabs > li', this.$container).removeClass('current');
        $('.tab-content', this.$container).removeClass('current');
        $(this).addClass('current');
        $('.tab-content-' + tab_id, this.$container).addClass('current');
      })
    },
    tabsSpaceCheck: function(){
      var tabsWidth = $('.tabs', this.$container).width();
      var tabsWrapper = $('.productTabsWrapper', this.$container).width()-31;
      if (tabsWidth >= tabsWrapper){
        $('.product-tabs', this.$container).css({
           'position' : 'absolute',
           'left' : '-9999px',
           'display': 'table'
        });
        $('.product-accordion', this.$container).show();
      } else {
        $('.product-tabs', this.$container).removeAttr( 'style' );
        $('.product-accordion', this.$container).hide();
      }
    },
    /**
     * Event callback for Theme Editor `section:unload` event
     */
    onUnload: function() {
      this.$container.off(this.namespace);
    }
  });

  return Product;
})();

theme.Parallax = (function() {
  function Parallax(container) {
    var $container = this.$container = $(container);
    var id = this.id =  $container.attr('data-section-id');
    var $featuredImage = this.$featuredImage = $('#FeaturedImage-'+id);
    var featuredImageSelector = this.featuredImageSelector = '#FeaturedImage-'+id;
    var parallaxSliderSelector = this.parallaxSliderSelector = '#FeaturedImage-'+id + " .parallax-slider";
    var $sectionBelow = this.$sectionBelow = this.$container.closest('.shopify-section').next();
    var $sectionAbove = this.$sectionAbove = this.$container.closest('.shopify-section').prev();

    this.layout();
    this.init();
    theme.transparentHeader();
  }

  Parallax.prototype =  $.extend({}, Parallax.prototype, {
    init: function(){
    var parallaxSliderSelector = this.parallaxSliderSelector = '#FeaturedImage-'+ this.id + " .parallax-slider";

      if ( this.$sectionBelow ){
        var parallaxBelow = this.parallaxBelow = this.$sectionBelow.children().first().attr('data-parallax-src');
      }
      if ( this.$sectionAbove ){
        var parallaxAbove = this.parallaxAbove = this.$sectionAbove.children().first().attr('data-parallax-src');
        this.$sectionAbove.children().first().attr('data-parallax-src');
      }
      var bleedAmount =  this.bleedAmount = 0;
      if ( this.parallaxBelow == undefined && this.parallaxAbove == undefined ){
        this.bleedAmount = 60;
      }

      if (this.$featuredImage.attr('data-parallax-src')) {
        this.$featuredImage.parallax({
          src: this.$featuredImage.data('parallax-src'),
          parallax: 'scroll',
          bleed: this.bleedAmount,
          excludeAgents: /(iPod)/,
          mirrorSelector: this.featuredImageSelector
        });

        var parallaxSlider = this.parallaxSliderSelector;
        $.each( $(this.featuredImageSelector).data(), function(key,val){
          if (key == 'widths' ){
           val = "[" + val + "]"
          }
          var kebabKey = "data-" + key;
          kebabKey = kebabKey.replace( /([a-z])([A-Z])/g, '$1-$2' ).toLowerCase();
          $(parallaxSlider).attr( kebabKey, val );
        });
        $(parallaxSlider).addClass('lazyload');
      }
    },

    layout: function() {
      var $sectionBelow = this.$sectionBelow = this.$container.closest('.shopify-section').next();
      var hasOverlapBelow = this.hasOverlapBelow = this.$sectionBelow.find('[data-overlay]').attr('data-overlay');
      var tallest = this.$sectionBelow.children().first().data('tallest')

      if( this.hasOverlapBelow == 'true' ){
        var topOffset = tallest + ( $('.timeshow__date').innerHeight() );
        this.$sectionBelow.addClass('timeshow--offset');

        // prevent layout conflicts by adding padding-bottom to hero text wrapper and min height to image
        $('.hero__content__wrapper', this.$container).css( "padding-bottom", function() {
          return topOffset + 30;
        });
        $('[data-prevent-overflow]', this.$container).css( "min-height", function() {
          heroHeight = $('[data-prevent-overflow-content]', this.$container).outerHeight(true);
          return topOffset + heroHeight;
        });
        $('.scroll_icon_wrap', this.$container).hide();

        // Pull date and images into the hero
        $('.timeshow__wrapper', this.$sectionBelow).css( "transform","translateY(-"+ topOffset +"px)");
        var currentScope = this;
        $('.timeshow__wrapper', this.$sectionBelow).css( "height", function() {
          var tallestText = 0;
          $('.timeshow__text', this.$sectionBelow).each(function () {
            if ($(this).height() > tallestText) {
              tallestText = $(this).height();
            }
          });
          return tallestText + 60;
        });
        $(window).trigger('resize');

      } else {
        this.$sectionBelow.removeClass('timeshow--offset');
        $('.timeshow__wrapper', this.$sectionBelow).css( "transform","translateY(0px)");
        $('.timeshow__wrapper', this.$sectionBelow).css( "height","auto");
        $('.hero__content__wrapper').css( "padding-bottom", "0px");
        $('.scroll_icon_wrap').show();
        $(window).trigger('resize');
      }
    },
    onReorder: function() {
      this.layout();
      theme.transparentHeader();
    },
    onUnload: function() {
      this.layout();
      if (this.$featuredImage.attr('data-img-src')) {
        this.$featuredImage.parallax('destroy');
      }
    }
  });

  return Parallax;
})();

